export function add03(a: number, b: number): number {
  return a + b;
}

export function subtract03(a: number, b: number): number {
  return a - b;
}

export function multiply03(a: number, b: number): number {
  return a * b;
}

export function divide03(a: number, b: number): number {
  return a / b;
}
